import React from 'react';
import './App.css';
import TopMenu from './TopMenu.js';
import AboutMe from './AboutMe.js';
import HomePage from './HomePage.js';



class App extends React.Component {
  render() {
    return (<>
        <div className="App">
          <TopMenu />
          <HomePage />
          <AboutMe />
        </div>
      </>
    )
  }
}

export default App;
